import React from "react";
import NavBar from "./navbar";
const ProjectDetails = ({ navHidden, hideNav, switchNavState }) => {
  return (
    <div className="form">
      <NavBar
        color="black"
        active="sign-in"
        navHidden={navHidden}
        hideNav={hideNav}
        switchNavState={switchNavState}
      />
    </div>
  );
};

export default ProjectDetails;
